Pistol's Mistake

Aug 10, 2012 - Performers: Krysta Kaos and Beretta James 


MP4 only.        


Sometimes a slave needs to be reminded of their place and tonight is no exception. These slaves have been trained to be the best they can be, so when one of them step out of line they are punished, no matter the setting. This time it was pistol who decided to socialize instead of doing her duties. We notice this and instantly dish out a brutal punishment. Now that the slaves are back in line we continue in true TUF form and celebrate one of our guests birthday by letting everyone in attendance to spank her. The finale is her along with kaos being made to squirt uncontrollably. Happy birthday Siouxsi Q!!! 

